Beexcellent Gaming Headset Stereo Headphone with Mic LED Light for PS4 Xbox PC
<br><br>
鮮やかな音場、サウンドの明晰さ、サウンドショック感をもたらして、幅広い 、音楽、様々なゲームを楽しめる。<br>
3.5chバーチャルサラウンド ゲーム音を忠実に出力するために高音域から低音域までフラットな音圧で出力できる設計になっております。 ノイズキャンセリング機能 騒音抑制機能付です。マイクを自由に動かすことが出来るので、音を360度拾うことができます。<br><br>

【対応機器】<br>3.5mmコネクタでノートパソコン（付属のケーブルで接続する必要）、iPad 、スマートフォン、またPS4ゲームプレイ、DVD、オンデマンド、映画、音楽、skype、チャット等を快適にプレイことができます。<br>※XBOX ONEをヘッドセットとして使うには変換アダプターが必要です（別途でご購入ください）。<br><br>

【商品仕様】 <br>ドライバ直径: 50 mm 感度: 105dB +/- 3dB at 1KHz マイクサイズ：6.0 × 5.0mm マイク感度: -38db ±3db 　ヘッドホンサイズ：約20 × 10 × 21cm <br><br><br>


パッケージ：<br>
1 x ヘッドセット<br>
1 x 取扱説明書（多言語）<br>
付属品：1 xデスクトップ用ケーブル<br><br>
【注】このヘッドセットはUSBヘッドセットではなく、USBインターフェースはLEDライトに電力を供給するために使われます。インストールドライバーが必要なく、挿せばすぐに再生可能です。</DIV>
